import  React, { useEffect,useState } from 'react'
import axios from 'axios'
import serverApiHost from "../../global";


import ViewAllCards from '../Card/AllCardsView/ViewAllCards'
import IDataCardVSM from '../../Component/Data/IDataCardVSM'
import { Divider, ListItemIcon, ListItemText, MenuItem, MenuList } from '@material-ui/core';
import { Check } from '@material-ui/icons';

interface MyCards{
    nameProduct: string,
    sections: IDataCardVSM[]
}

interface AllCards
{
    message: string,
    cards: MyCards[]
}

const PageAllCards = () =>
{

    const [dataCards, setDataCards] = useState<AllCards>()

    const GetInformationAboutCard = async () => {

        const response = await axios.get('http://'+serverApiHost+':5001/api/cardVSM/view')

        if(response.status != 200)
        {
          return ;
        }

        let content = response.data as AllCards;

        setDataCards(content);

        console.log("LOADING = ",content)

    }


    useEffect(() => {
         GetInformationAboutCard();
    },[])


    if(dataCards === undefined)
    {
        return <div>

        </div>;
    }   

    console.log("LOADING  2= ",dataCards)
    return (
        <div style={{flex: '0 0 auto'}}>
            <div>
                {/* List cards in system*/}
                {dataCards?.cards.map( (item: MyCards,i: number) => {
                    return  <p>{item.nameProduct}</p>
                })}

<MenuList dense>
        <MenuItem>
          <ListItemText inset>Single</ListItemText>
        </MenuItem>
        <MenuItem>
          <ListItemText inset>1.15</ListItemText>
        </MenuItem>
        <MenuItem>
          <ListItemText inset>Double</ListItemText>
        </MenuItem>
        <MenuItem>
          <ListItemIcon>
            <Check />
          </ListItemIcon>
          Custom: 1.2
        </MenuItem>
        <Divider />
        <MenuItem>
          <ListItemText>Add space before paragraph</ListItemText>
        </MenuItem>
        <MenuItem>
          <ListItemText>Add space after paragraph</ListItemText>
        </MenuItem>
        <Divider />
        <MenuItem>
          <ListItemText>Custom spacing...</ListItemText>
        </MenuItem>
      </MenuList>
            </div>
            <div>
                <p>PageAllCards</p>
                <p>{dataCards?.message}</p>

                {/*dataCards?.card.map( (item: any,i: number) => {
                    return  <div><ViewAllCards key={i} item={item}/></div>
                })*/}
            </div>
        </div>
    )   
}


export default PageAllCards;
